import React from "react";
import styles from "./ListItem.module.css";

export const ListItem = () => {
  return (
    <>
      <div className={styles["header-wrap"]}>
        <div>Full name</div>
        <div>Birthday</div>
        <div>Gender</div>
        <div>Department</div>
        <div>Salary</div>
      </div>
    </>
  );
};
